function IconsFooter() {
  return (
    <>
      <img src="wemail.svg" alt="email" />
      <img src="winstagram.svg" alt="instagram" />
      <img src="wlinkedin.svg" alt="linkedin" />
      <img src="wtwitter.svg" alt="twitter" />
      <img src="wwhatsapp.svg" alt="whatsapp" />
      <img src="wzoom.svg" alt="zoom" />
    </>
  );
}
function ParagFooter() {
  return (
    <p>
      Thank you for visiting our website! We hope you had a pleasant experience
      and were able to find what you were looking for. It was a pleasure having
      you here and we hope to see you again soon. If you have any feedback or
      suggestions for us, please don't hesitate to reach out. Until next time,
    </p>
  );
}
function SpanFooter() {
  return <p>take care and have a great day!</p>;
}
function HeadLeftFooter() {
  return <h1>Let's grab some coffee!</h1>;
}
function BottomLeftFooter() {
  return (
    <>
      <img src="madeBy.png" alt="MADE_BY" className="made-by-img" />
      <img src="gallery.png" alt="GALLERY" className="gallery-img" />
      <p>saja.Gallery 2023 Â© || Developed By Ahmed El-Sammak</p>
    </>
  );
}
export default function Footer() {
  return (
    <div className="footer">
      <ParagFooter />
      <SpanFooter />
      <IconsFooter />
      <HeadLeftFooter />
      <BottomLeftFooter />
    </div>
  );
}
